const Index = () => {

  return (
    <main>
      <div id="header">header</div>
      <div id="navbar">navbar</div>
      <div id="carroussel">carroussel</div>
      <div id="presentation"></div>
      <div id="localization"></div>
      <div id="keys"></div>
      <div id="reviews"></div>
      <div id="partners"></div>
      <div id="contact"></div>
    </main>
  );

}

export default Index;
